        <JpopButton />
        <VideogamesButton />
      </div>
      <div className={classes["user-header"]}>
        <Button className={classes["help-button"]} />
        <Button className={classes["help-button"]} onclick={showMenuHandler} />
        
      </div>
    </div>
  );
};

export default Header;
